import logo from './logo.svg';
import './App.css';

var dictionary = {};

function App() {
  var word = "home";
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Testing word: {word}
        </p>
        <p>
          {word} is hash # {hash(word)}
        </p>
        <p>
          {word} has value {dictionary[hash(word)]}
        </p>
      </header>
    </div>
  );
}

function wordToEtymology(wordP){
  dictionary[hash(wordP)] = wordP;
}

function hash(stringP){
  var h = 0;
  var i = 0;
  for(i = 0; i < stringP.length; i++){
    var ch = stringP.charCodeAt(i);
    h = ((h << 5) - h) + ch;
    h = h & h;
  }
  return h;
}

export default App;
